  const { title } = useParams();

  return (
    <>
      <div>
        {data
          .filter((card) => card.title === title)
          .map((card, index) => (
            <div key={index} className="fullCard">
              <h1>{card.hotel_name}</h1>
              <p>{card.description}</p>
              <Link to={`/cards/nextcard/${card.title}`} >Till n√§sta</Link>
            </div>
          ))}
      </div>
    </>
  );
};

export default FullCard;
